          <link href="resources/css/price-range.css" rel="stylesheet" />
          <link href="resources/css/animate.css" rel="stylesheet" />
          <link href="resources/css/main.css" rel="stylesheet" />
          <link href="resources/css/responsive.css" rel="stylesheet" />
          <link
            href="resources/css/bootstrap-responsive.min.css"
            rel="stylesheet"
          />
        </Helmet>
        <style>{`
      .midimg
      {
          display: block;
          margin-left: auto;
          margin-right: auto;
      }
      .searchform input 
      {
          width: 169px;
          height: 33px
      }
      ::-webkit-input-placeholder 
      { /* Chrome/Opera/Safari */
          color: lightgrey;
      }
      ::-moz-placeholder 
      { /* Firefox 19+ */
          color: lightgrey;
      }
      :-ms-input-placeholder 
      { /* IE 10+ */
          color: lightgrey;
      }
      :-moz-placeholder 
      { /* Firefox 18- */
          color: lightgrey;
      }
      .swapper:hover 
      {
          color: #F39C12;
          border: 1px solid #F39C12;
      }
      .aswap:hover
      {
          color: white;
          background: #F39C12;
          border: 1px solid #F39C12;
      }
      .swappor  
      {
          color: white;
          background: #F39C12;
          border: 1px solid #F39C12;
      }
      .swappor:hover 
      {
          color: black;
          background: #EBEDEF;
          border: 1px solid black;
      }
      .pull-center:hover 
      {
          color: black;
          font-weight: bold;
      }
      .demo
      {
        display: inline-block;
      }
      .demo a
      {
        color: red; 
        padding: 5px 12px; 
        text-decoration: none; 
        transition: background-color 2s; 
        border: 1px solid orange; 
        font-size: 15px;
      } 
      .demo a.active
      {
        background-color: orange; 
        color: white;
      }
            .demo a:hover
      {
        background-color: orange; 
        color: white;
      }
        .reddit 
      {
          border: 2px solid red;
      }
    .reddot:hover 
      {
          border: 2px solid red;
      }
    `}</style>
        <div className="overlay" />
        <section className="top-part">
          <img src={wall} />
        </section>
        <section className="cd-hero">
          <br />
          <img
            src={eng}
            width={25}
            height={25}
            className="reddit"
            style={{ position: "absolute", top: 25, right: 30 }}
          />
          <img
            src={tha}
            width={25}
            height={25}
            className="reddot"
            style={{ position: "absolute", top: 25, right: 70 }}
          />
          <div className="cd-slider-nav">
            <nav>
              <span className="cd-marker item-1" />
              <ul>
                <li>
                  <a>
                    <div className="image-icon">
                      <img src={but1} width={42} height={42} />
                    </div>
                    <h6>Detail</h6>
                  </a>
                </li>
              </ul>
            </nav>
          </div>
          <ul className="cd-hero-slider">
            <li className="selected">
              <div className="heading"></div>
              <div className="cd-full-width fivth-slide">
                <div className="container">
                  <div className="row">
                    <div className="col-md-13">
                      <div className="content fivth-content">
                        <div className="row">
                          <form id="contact" action method="post">
                            <div className="col-md-12">
                              <table
                                className="table-condensed"
                                style={{ float: "right" }}
                              >
                                <tbody>
                                  <tr>
                                    <td className="cart_delete">
                                      <a
                                        className="cart_quantity_delete"
                                        onClick={() => {
                                          history.push("/d_main");
                                          window.location.reload();
                                        }}
                                      >
                                        <i className="fa fa-times" />
                                      </a>
                                    </td>
                                  </tr>
                                </tbody>
                              </table>
                              <h2
                                style={{
                                  fontSize: "18px",
                                  color: "#F39C12",
                                  textAlign: "left",
                                }}
                              >
                                Most suitable service
                              </h2>
                              <br />
                              <div className="brands-name">
                                <fieldset>
                                  <div className="col-md-4">
                                    <img
                                      htmlFor="grab"
                                      style={{
                                        width: "50px",
                                        height: "50px",
                                      }}
                                      className="midimg"
                                      src={del1}
                                      alt=""
                                    />
                                    <input
                                      type="radio"
                                      id="grab"
                                      defaultValue="grab"
                                      style={{ marginLeft: "48%" }}
                                    />
                                  </div>
                                  <div className="col-md-4">
                                    <img
                                      htmlFor="get"
                                      style={{
                                        width: "50px",
                                        height: "50px",
                                      }}
                                      className="midimg"
                                      src={del2}
                                      alt=""
                                    />
                                    <input
                                      type="radio"
                                      id="get"
                                      defaultValue="get"
                                      style={{ marginLeft: "48%" }}
                                    />
                                  </div>
                                  <div className="col-md-4">
                                    <img
                                      htmlFor="line"
                                      style={{
                                        width: "50px",
                                        height: "50px",
                                      }}
                                      className="midimg"
                                      src={del3}
                                      alt=""
                                    />
                                    <input
                                      type="radio"
                                      id="line"
                                      defaultValue="line"
                                      style={{ marginLeft: "48%" }}
                                    />
                                  </div>
                                </fieldset>
                              </div>
                              <br />
                              <h2
                                style={{
                                  fontSize: "18px",
                                  color: "#F39C12",
                                  textAlign: "left",
                                }}
                              >
                                Alternative service
                              </h2>
                              <br />
                              <div className="brands-name">
                                <fieldset>
                                  <div className="col-md-4">
                                    <img
                                      htmlFor="grab"
                                      style={{
                                        width: "50px",
                                        height: "50px",
                                      }}
                                      className="midimg"
                                      src={del4}
                                      alt=""
                                    />
                                    <input
                                      type="radio"
                                      id="grab"
                                      defaultValue="grab"
                                      style={{ marginLeft: "48%" }}
                                    />
                                  </div>
                                  <div className="col-md-4">
                                    <img
                                      htmlFor="get"
                                      style={{
                                        width: "50px",
                                        height: "50px",
                                      }}
                                      className="midimg"
                                      src={del5}
                                      alt=""
                                    />
                                    <input
                                      type="radio"
                                      id="get"
                                      defaultValue="get"
                                      style={{ marginLeft: "48%" }}
                                    />
                                  </div>
                                  <div className="col-md-4">
                                    <img
                                      htmlFor="line"
                                      style={{
                                        width: "50px",
                                        height: "50px",
                                      }}
                                      className="midimg"
                                      src={del6}
                                      alt=""
                                    />
                                    <input
                                      type="radio"
                                      id="line"
                                      defaultValue="line"
                                      style={{ marginLeft: "48%" }}
                                    />
                                  </div>
                                </fieldset>
                              </div>
                            </div>
                            <div className="col-md-12">
                              <fieldset>
                                <br />
                                <br />
                              </fieldset>
                            </div>
                            <div className="col-md-12">
                              <fieldset>
                                <a
                                  className="btn swappor"
                                  style={{ float: "right" }}
                                >
                                  <i className="fa fa-qrcode" />
                                   Send to agency
                                </a>
                              </fieldset>
                            </div>
                            <div className="col-md-12">
                              <fieldset>
                                <br />
                              </fieldset>
                            </div>
                          </form>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </li>
          </ul>
        </section>
        <footer>
          <p>
            Copyright © 2020 | Phlad Rian, The School Equipment Donation Website
          </p>
        </footer>
      </div>
    </div>
  );
